import React from "react";
import './App.css';
import {
    SearchOutlined,
    MenuUnfoldOutlined,
    BellOutlined,
  } from "@ant-design/icons";
  import { Tag, Button, Breadcrumb, Divider } from "antd";
  function Reviewheader ()  {
    return(
        <nav className="topbar">
            <div className="left">
                <div className="menu">
                <MenuUnfoldOutlined />
                </div>
                <div className="Tittle">
                    Profile
                    </div>

            </div>
            <div className="Right">
            <Button className="searchBtn" shape="circle" icon={<SearchOutlined />} />


            </div>

        </nav>
    )}
    export default Reviewheader
